import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Sales() {

  const [mydata, setdata] = useState([]);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/project/sales/')
      .then((res) => setdata(res.data));
  }, []);

  return (
    <>
      <h1>Sales Data</h1>
      
      {mydata.map((sales) => {
        const { customer_id } = sales;
        return <h2 key={customer_id}>{customer_id}</h2>;  // Added return and key prop
      })}
    </>
  );
}

export default Sales;
